function App() {
  const isLoggedIn = false;

  let greetings;

  if(isLoggedIn){
    greetings = <h1>Welcome, user!</h1>
  }else{
    greetings = <h1>Plase, log in</h1>
  }
  return(
    <div>
      {greetings}
    </div>
  )
}

export default App;
